It was another fast stage and the team focused on making sure Wilco was always in a good position and protected in case of echelons and splits in the peloton. In the closing kilometers I was in the front but in the final approach, before the last turn, I was a bit further back, not in an ideal position. As a result, I wasn't able to launch my sprint when I would have liked. My knee is getting better and I'll keep fighting.

Bola to ďalšia rýchla etapa a náš tím sa zameral na to aby sme Wilca udržali v dobrej pozícii a ochránili ho v prípade bočného vetra a delenia pelotónu. V záverečných kilometroch som bol vpredu, ale vo finále, tesne pred poslednou zákrutou som sa ocitol o niečo ďalej vzadu na nie úplne ideálnej pozícii.  Výsledkom bolo, že keď som chcel začať špurtovať, tak som vlastne ani nemal priestor. Koleno sa mi zlepšuje a samozrejme budem bojovať ďalej.

@borahansgrohe @letourdefrance (Photos @bettiniphoto)

We had a very fast sprint where I finished fifth. I still have a bit of knee pain but, again, I gave my absolute best. It's a good thing we didn't have any crashes and that we are all sound and safe. We'll see tomorrow how everything goes.

Bol to veľmi rýchly špurt a ja som skončil piaty.  Stále ma trochu bolí koleno, ale opäť som dal zo seba absolútne maximum. Je dobré, že sme nemali žiadne pády a že sme všetci zdraví a v bezpečí. Uvidíme zase zajtra ako nám to pôjde.

@letourdefrance @borahansgrohe (Photos @bettiniphoto)

My crash yesterday was hard and I still had knee pain today but it was gradually getting better in the final 35km. The team did a fantastic job in keeping me in position in the tricky part, especially Nils and Daniel. The last 5km were again hectic because Van Moer was still in front. I found myself a bit out of position and didn't have enough time to recover positions in the last kilometer, so I started my sprint from further back. However, it was a good effort, I feel optimistic about the upcoming days and I will, obviously, keep fighting.

Môj včerajší pád bol celkom ťažký a dnes som mal neustále bolesti kolena, ale v záverečných 35 km sa to postupne zlepšovalo. Tím opäť odviedol skvelú prácu a udržal ma na dobrej pozícii aj v zložitej časti etapy. Určite mi najviac pomohli najmä Nils a Daniel. Posledných 5 km bolo opäť hektických, pretože Van Moer bol stále vpredu. Ocitol som sa trochu mimo svoju ideálnu pozíciu a na poslednom kilometri som nemal dostatok času na jej zlepšenie a tak som začal svoj špurt viac vzadu. Bolo to však dobré a aj nadchádzajúce dni vidím  optimisticky a budem samozrejme bojovať ďalej.

@letourdefrance @borahansgrohe (Photos @bettiniphoto)
